import React, { useState } from "react";
import PokemonPage from "./pages/PokemonPage";
import AuthPage from "./pages/AuthPage";
import "./App.css";

function App() {
  const [user, setUser] = useState(null);
  return user ? <PokemonPage /> : <AuthPage onLogin={(u) => setUser(u)} />;
}

export default App;
